import React from "react";
import "./Styles/Header.css";

const Header = ({ title, count }) => {
  return (
    <div className="Header">
      <div className="text-container">
        <div className="title">{title}</div>
        <div className="count">{count}</div>
      </div>
    </div>
  );
};

export default Header;
